sap.ui.define(["sap/ui/test/opaQunit","./pages/Master"],function(e){"use strict";QUnit.module("Master List");e("Should see the master list with all entries",function(e,t,s){e.iStartMyApp();s.onTheMasterPage.iShouldSeeTheList().and.theListShouldHaveAllEntries().and.theHeaderShouldDisplayAllEntries()});e("Search for the First object should deliver results that contain the firstObject in the name",function(e,t,s){t.onTheMasterPage.iSearchForTheFirstObject();s.onTheMasterPage.theListShowsOnlyObjectsWithTheSearchStringInTheirTitle()});e("Entering something that cannot be found into search field and pressing search field's refresh should leave the list as it was",function(e,t,s){t.onTheMasterPage.iTypeSomethingInTheSearchThatCannotBeFoundAndTriggerRefresh();s.onTheMasterPage.theListHasEntries()});e("Entering something that cannot be found into search field and pressing 'search' should display the list's 'not found' message",function(e,t,s){t.onTheMasterPage.iSearchForSomethingWithNoResults();s.onTheMasterPage.iShouldSeeTheNoDataTextForNoSearchResults().and.theListHeaderDisplaysZeroHits()});e("Should display items again if the searchfield is emptied",function(e,t,s){t.onTheMasterPage.iClearTheSearch();s.onTheMasterPage.theListShouldHaveAllEntries()});e("MasterList Sorting on Name",function(e,t,s){t.onTheMasterPage.iSortTheListOnName();s.onTheMasterPage.theListShouldBeSortedAscendingOnName();s.iTeardownMyApp()})});